import uwLogo from '../../resources/color-UWcrest-print.png'

export default class Header extends React.PureComponent{
    render(){
        return(
            <div style={{width: "100%", height: "10%",  flex:1, flexDirection: 'column', textAlign: 'left'}}>
                <img src={require(uwLogo)}></img>
                <text style={{fontFamily: 'Helvetica', fontSize: 40}}>
                    Max Johnson
                </text>
            </div>
        )
    }
}
